            nom:"DAVY",
            img:"imgtest3.jpeg"
        },

        {
            id:2,
            nom:"Emma",
            img:".imgtest1.jpeg"
        },

        {
            id:2,
            nom:"Norah",
            img:"imgtest3.jpeg"
        },

    ])

    return (
        <div>
            {produits.map(item=>{
                return <Produit keys={item.id} {...item} item={item} />
            })}
        </div>
    )
}
